import axiosApi from './apiAxios.js'
import baseUrl from './baseUrl.js'

let dictItem = new Map()

const apiList = {
  /**
   * 字典
   */
  getDictionaryItem: {
    method: 'POST',
    url: baseUrl + `api/authority/dictionaryItem/anno/query`
  },

  /**
   * 是否开启历史
   */
  formHistoryRecord: {
    method: 'GET',
    url: baseUrl + `api/wx/regGuide/formHistoryRecord`
  }

}

/**
 * 获取数据字典
 */
function getDictionaryItem () {
  return axiosApi({
    ...apiList.getDictionaryItem
  })
}

/**
 * 是否开启历史
 * @returns {Promise<>}
 */
function formHistoryRecord () {
  return axiosApi({
    ...apiList.formHistoryRecord
  })
}

const constantItem = {

  getDictItem (code) {
    const dictItemLocal = localStorage.getItem('dictItem')
    if (dictItemLocal && dictItemLocal !== 'undefined') {
      const dictItemJson = JSON.parse(dictItemLocal)
      for (let i = 0; i < dictItemJson.length; i++) {
        dictItem.set(dictItemJson[i].code, dictItemJson[i].name)
      }
    }
    return dictItem.get(code)
  },
  initDict () {
    getDictionaryItem().then(res => {
      if (res.code === 0) {
        const dict = res.data
        console.log('getDictionaryItem', dict)
        localStorage.setItem('dictItem', JSON.stringify(dict))
        for (let i = 0; i < dict.length; i++) {
          dictItem.set(dict[i].code, dict[i].name)
        }
      }
    })
  },
  /**
   * 患者名字 和备注
   * @param patientName
   * @param remark
   * @returns {*}
   */
  formatPatientName (patientName, remark) {
    if (remark) {
      return patientName + '(' + remark + ')'
    }
    return patientName
  },
  showHist () {
    formHistoryRecord().then(res => {
      if (res.code === 0) {
        localStorage.setItem('formHistoryRecord', res.data)
        return localStorage.getItem('formHistoryRecord')
      }
    })
  },
  getShowHist () {
    if (localStorage.getItem('formHistoryRecord')) {
      return localStorage.getItem('formHistoryRecord')
    } else {
      this.showHist()
    }
  },
  /**
   * 随机获取一个医生的头像
   */
  getDoctorDefaultAvatar (type) {
    if (type === 'noAvatar') {
      return 'data:image/png;base64,'
    }
    let randomNum = Math.round((Math.random() * new Date().getTime()) % 1000000000000) % 5
    if (randomNum === 1) {
      // '@/assets/avatar/huang_se.png' 的base64
      return 'data:image/png;base64,'
    } else if (randomNum === 2) {
      // return '@/assets/avatar/lan_se.png'
      return 'data:image/png;base64,'
    } else if (randomNum === 3) {
      // return '@/assets/avatar/lu_se.png'
      return 'data:image/png;base64,'
    } else {
      // return '@/assets/avatar/zi_se.png'
      return 'data:image/png;base64,'
    }
  }

}

export default constantItem
